const HeaderNavBar = (props) => {
      const { handleText, handleAction } = props;

      goToLink = '/login';
      return (
            <nav className='container'>
                  <div className='brandFont'>
                        <a href='/'>Music-Map</a>
                  </div>

                  <div>
                        {handleText === 'Logout' ? (
                              <button
                                    bsStyle='primary'
                                    className=' mr-sm-2'
                                    onClick={handleAction}
                              >
                                    {handleText}
                              </button>
                        ) : (
                              <button
                                    href={goToLink}
                                    bsStyle='primary'
                                    className=' mr-sm-2'
                              >
                                    {handleText}
                              </button>
                        )}
                  </div>
            </nav>
      );
};

export default HeaderNavBar;
